			runOnlyForDeploymentPostprocessing = 0;
			shellPath = /bin/sh;
			shellScript = "# Xcode Cloud: Install all dependencies and Pods\n# This runs BEFORE Pods check to ensure everything is ready\n# Don't use set -e - handle errors manually for better debugging\n\n# Skip if running locally and everything already exists\nif [ \"${CI}\" != \"true\" ] && [ -d \"${SRCROOT}/Pods\" ] && [ -f \"${SRCROOT}/Pods/Manifest.lock\" ] && [ -d \"${SRCROOT}/../../node_modules\" ]; then\n    echo \"âœ… Dependencies already installed, skipping...\"\n    exit 0\nfi\n\necho \"ðŸ”§ Starting dependency installation...\"\necho \"ðŸ“ SRCROOT: ${SRCROOT}\"\necho \"ðŸ“ CI: ${CI}\"\n\n# Navigate to repo root\nREPO_ROOT=\"${SRCROOT}/../../..\"\nif [ ! -f \"$REPO_ROOT/package.json\" ]; then\n    REPO_ROOT=\"${SRCROOT}/../..\"\nfi\n\nif [ ! -f \"$REPO_ROOT/package.json\" ]; then\n    echo \"error: Cannot find package.json at $REPO_ROOT/package.json\" >&2\n    echo \"error: Tried: ${SRCROOT}/../../.. and ${SRCROOT}/../..\" >&2\n    exit 1\nfi\n\ncd \"$REPO_ROOT\" || {\n    echo \"error: Cannot cd to repository root: $REPO_ROOT\" >&2\n    exit 1\n}\n\necho \"ðŸ“ Repository root: $(pwd)\"\n\n# CRITICAL: Find npm - use multiple strategies\n# Strategy 1: Try to find npm in PATH\nNPM_CMD=\"\"\nif command -v npm &> /dev/null; then\n    NPM_CMD=\"npm\"\n    echo \"âœ… Found npm in PATH: $(which npm)\"\n# Strategy 2: Use npm from node_modules (if it exists)\nelif [ -f \"node_modules/.bin/npm\" ]; then\n    NPM_CMD=\"node node_modules/.bin/npm\"\n    echo \"âœ… Using npm from node_modules/.bin/npm\"\n# Strategy 3: Find node and use it to locate npm\nelif command -v node &> /dev/null; then\n    NODE_DIR=\"$(dirname $(which node))\"\n    if [ -f \"$NODE_DIR/npm\" ]; then\n        export PATH=\"$NODE_DIR:$PATH\"\n        NPM_CMD=\"npm\"\n        echo \"âœ… Found npm via node at: $NODE_DIR/npm\"\n    else\n        # Use node to run npm scripts directly\n        NPM_CMD=\"node node_modules/.bin/npm\"\n        echo \"âœ… Using node to run npm from node_modules\"\n    fi\n# Strategy 4: Check common installation paths\nelse\n    for NODE_PATH in \"/usr/local/bin\" \"/opt/homebrew/bin\" \"/usr/bin\" \"/opt/pmk/env/global/bin\"; do\n        if [ -f \"$NODE_PATH/node\" ] && [ -f \"$NODE_PATH/npm\" ]; then\n            export PATH=\"$NODE_PATH:$PATH\"\n            NPM_CMD=\"npm\"\n            echo \"âœ… Found npm at: $NODE_PATH/npm\"\n            break\n        fi\n    done\nfi\n\n# Final fallback: use node_modules npm if available\nif [ -z \"$NPM_CMD\" ] && [ -f \"node_modules/.bin/npm\" ]; then\n    NPM_CMD=\"node node_modules/.bin/npm\"\n    echo \"âœ… Fallback: Using npm from node_modules/.bin/npm\"\nfi\n\n# Verify we have a way to run npm\nif [ -z \"$NPM_CMD\" ]; then\n    echo \"error: Cannot find npm or node\" >&2\n    echo \"PATH: $PATH\" >&2\n    echo \"Checking for node:\" >&2\n    which node || echo \"node not found\" >&2\n    echo \"Checking for node_modules/.bin/npm:\" >&2\n    ls -la node_modules/.bin/npm 2>&1 || echo \"node_modules/.bin/npm not found\" >&2\n    exit 1\nfi\n\n# Install npm dependencies (if needed)\nif [ ! -d \"node_modules\" ]; then\n    echo \"ðŸ“¦ Installing npm dependencies...\"\n    if ! $NPM_CMD ci; then\n        echo \"âš ï¸  npm ci failed, trying npm install...\"\n        if ! $NPM_CMD install; then\n            echo \"error: Both npm ci and npm install failed\" >&2\n            exit 1\n        fi\n    fi\n    echo \"âœ… npm dependencies installed\"\nelse\n    echo \"âœ… node_modules already exists\"\nfi\n\n# CRITICAL: Create .env file from Xcode Cloud environment variables\n# Vite needs these at BUILD TIME, not runtime\nif [ \"${CI}\" = \"true\" ]; then\n    echo \"ðŸ”§ Creating .env file from Xcode Cloud environment variables...\"\n    \n    # Check if environment variables are set\n    if [ -z \"${VITE_SUPABASE_URL}\" ] || [ -z \"${VITE_SUPABASE_PUBLISHABLE_KEY}\" ]; then\n        echo \"âš ï¸  WARNING: Environment variables not set in Xcode Cloud!\" >&2\n        echo \"   VITE_SUPABASE_URL: ${VITE_SUPABASE_URL:+SET}\" >&2\n        echo \"   VITE_SUPABASE_PUBLISHABLE_KEY: ${VITE_SUPABASE_PUBLISHABLE_KEY:+SET}\" >&2\n        echo \"   Build may fail or app may not work correctly.\" >&2\n    fi\n    \n    # Create .env file from environment variables\n    cat > .env << EOF\nVITE_SUPABASE_URL=${VITE_SUPABASE_URL:-}\nVITE_SUPABASE_PUBLISHABLE_KEY=${VITE_SUPABASE_PUBLISHABLE_KEY:-}\nEOF\n    \n    echo \"âœ… .env file created\"\n    echo \"ðŸ“‹ Verifying .env file contents (URL only, key hidden):\"\n    if [ -f \".env\" ]; then\n        grep \"VITE_SUPABASE_URL\" .env | sed 's/=.*/=***/' || true\n        echo \"   VITE_SUPABASE_PUBLISHABLE_KEY=***\"\n    fi\nfi\n\n# Build web app\nif [ ! -d \"dist\" ] || [ \"${CI}\" = \"true\" ]; then\n    echo \"ðŸ—ï¸  Building web app...\"\n    \n    # Export environment variables to ensure they're available to npm\n    export VITE_SUPABASE_URL=\"${VITE_SUPABASE_URL:-}\"\n    export VITE_SUPABASE_PUBLISHABLE_KEY=\"${VITE_SUPABASE_PUBLISHABLE_KEY:-}\"\n    \n    # Try build with error handling\n    echo \"ðŸ“¦ Running: $NPM_CMD run build\"\n    if ! $NPM_CMD run build 2>&1; then\n        echo \"error: npm run build failed\" >&2\n        echo \"ðŸ“‹ Build script details:\"\n        cat package.json | grep -A 2 '\"build\"' || true\n        echo \"\"\n        echo \"ðŸ’¡ Troubleshooting:\"\n        echo \"   1. Check if .env file exists: $(test -f .env && echo 'YES' || echo 'NO')\"\n        if [ -f \".env\" ]; then\n            echo \"   2. .env file contents (first 100 chars):\"\n            head -c 100 .env || true\n        fi\n        echo \"   3. Environment variables in shell:\"\n        echo \"      VITE_SUPABASE_URL: ${VITE_SUPABASE_URL:+SET}\"\n        echo \"      VITE_SUPABASE_PUBLISHABLE_KEY: ${VITE_SUPABASE_PUBLISHABLE_KEY:+SET}\"\n        echo \"   4. npm command used: $NPM_CMD\"\n        exit 1\n    fi\n    echo \"âœ… Web app built\"\nelse\n    echo \"âœ… dist already exists\"\nfi\n\n# Sync Capacitor - use npx from node_modules if needed\nif [ -f \"node_modules/.bin/npx\" ]; then\n    NPX_CMD=\"node node_modules/.bin/npx\"\nelif command -v npx &> /dev/null; then\n    NPX_CMD=\"npx\"\nelse\n    echo \"error: npx not found\" >&2\n    exit 1\nfi\n\necho \"ðŸ”„ Syncing Capacitor...\"\nif ! $NPX_CMD cap sync ios; then\n    echo \"error: Capacitor sync failed\" >&2\n    exit 1\nfi\necho \"âœ… Capacitor synced\"\n\n# Install Pods\ncd \"${SRCROOT}\" || {\n    echo \"error: Cannot cd to ${SRCROOT}\" >&2\n    exit 1\n}\n\nif [ ! -f \"Podfile\" ]; then\n    echo \"error: Podfile not found at ${SRCROOT}/Podfile\" >&2\n    exit 1\nfi\n\necho \"ðŸ“¦ Installing Pods...\"\nif ! command -v pod &> /dev/null; then\n    echo \"error: CocoaPods (pod) not found in PATH\" >&2\n    echo \"PATH: $PATH\" >&2\n    exit 1\nfi\n\nif ! pod install; then\n    echo \"error: pod install failed\" >&2\n    echo \"ðŸ“ Current directory: $(pwd)\"\n    echo \"ðŸ“ Podfile location: $(pwd)/Podfile\"\n    exit 1\nfi\n\necho \"âœ… All dependencies installed successfully\"\n";
